description:
.kha-info-table {
	background-color:#ffffff;
	border: 3px solid #bddbb2;
	margin-top: 20px;
	margin-bottom: 20px;
	}

table .kha-info-table {
	margin-top: 20px;
	margin-bottom: 20px;
	}

.kha-info-table td
{
	background-color:#ffffff;
	padding:5px;
	border-bottom: 1px #bddbb2 solid;
	border-left: 1px #bddbb2 solid;
	font-size:14px;
	}

.kha-info-table th
{
	background-color:#bddbb2;
	padding:5px;
	border-bottom: 1px #bddbb2 solid;
	border-left: 1px #bddbb2 solid;
	font-size:14px;
	text-align:center;
	}	


.kha-info-table .left
{
	text-align:left;
	border-left: none;
	}	

.kha-info-table .green td 
{
	background-color:#e9f3e5;
	}
